import React from 'react'
import "./Page404.css"

export default function Page404() {
  return (
    <div>
        <h1 className='underline text-4xl text-center mt-2'>Ошибка 404</h1>
        <h3 className='text-2l'>Не найдено</h3>
        <p className='text-3xl'>Данной страницы не существует</p>
    </div>
  )
}
